# Hash Table Example\nhash_table = {}\n\n# Insert\nhash_table["apple"] = 1\nhash_table["banana"] = 2\n\n# Lookup\nprint(hash_table.get("apple"))  # Output: 1\n\n# Trie Example\nclass TrieNode:\n    def __init__(self):\n        self.children = {}\n        self.is_end_of_word = False\n\nclass Trie:\n    def __init__(self):\n        self.root = TrieNode()\n    \n    def insert(self, word):\n        node = self.root\n        for char in word:\n            if char not in node.children:\n                node.children[char] = TrieNode()\n            node = node.children[char]\n        node.is_end_of_word = True\n    \n    def search(self, word):\n        node = self.root\n        for char in word:\n            if char not in node.children:\n                return False\n            node = node.children[char]\n        return node.is_end_of_word\n    \n    def starts_with(self, prefix):\n        node = self.root\n        for char in prefix:\n            if char not in node.children:\n                return False\n            node = node.children[char]\n        return True\n\n# Usage\ntrie = Trie()\ntrie.insert("apple")\ntrie.insert("banana")\n\nprint(trie.search("apple"))  # Output: True\nprint(trie.starts_with("app"))  # Output: True